import './App.css';
import HomePage from './HomePage';
import NotFound from './NotFound';

import {BrowserRouter as  Router, Route, Redirect, Switch} from 'react-router-dom'
const App = () => {
  return (
    <Router>
      <Switch>
        <Route path = '/' exact>
          <HomePage />
        </Route>
        <Redirect>
          <NotFound />
        </Redirect>
      </Switch>
    </Router>
  );
}

export default App;
